import React, { Component } from 'react';
import { Table } from 'antd';
import 'antd/dist/antd.css';
import IMG01 from '../../../assets/images/doctor-thumb-01.jpg';
import IMG02 from '../../../assets/images/doctor-thumb-02.jpg';
import IMG03 from '../../../assets/images/doctor-thumb-03.jpg';



class TableEmployees extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [
        { id: 1, image: IMG01, Name: "Dr. Ruby Perrin", Phone: "8286329170", LastVisit: "20 Oct 2019", Paid: '$100.00' },
        { id: 2, image: IMG02, Name: "Dr. Darren Elde", Phone: "2077299974", LastVisit: "22 Oct 2019", Paid: '$200.00' },
        { id: 3, image: IMG03, Name: "Dr. Deborah ", Phone: "2607247769", LastVisit: "21 Oct 2019", Paid: '$250.00' },


      ]
    }
  }
  render() {
    const { data } = this.props

    const columns = [
      {
        title: 'Employee Name',
        dataIndex: 'name',
        render: (text, record) => (
          <h2 className="table-avatar">
            <a href="/admin/profile" className="avatar avatar-sm mr-2"><img alt="" src={`http://excodeteam.com/crs/public/images/${record.photo}`} /></a>
            <a href="/admin/profile">{text}</a>
          </h2>
        ),
      },
      {
        title: 'Email',
        dataIndex: 'email'
      },
      {
        title: 'Mobile',
        dataIndex: 'mobile',
      },
    ]
    return (
      <div>
        <Table className="table-striped"
          style={{ overflowX: 'auto' }}
          columns={columns}
          // bordered
          dataSource={data}
          rowKey={record => record.id}
          pagination={false}
        />
      </div>

    )
  }
};

export default TableEmployees;
